import React, { Component } from "react";
import './navbar.scss'
import { Link, withRouter } from "react-router-dom";
// import { connect } from "react-redux";
// import { logoutUser } from "../../redux/actions";
export default class Navbar extends Component{
    render(){
        return(
        <div className="pf__title">
            <div className="pf__title--name">
                <p>Jubi  </p> 
                <p>  Chen</p>
            </div>
            <ul>
            {/* style="color:#86858A" */}
                <li ><Link to="/contact" className="pf__title--link">Contact</Link></li>
                <li ><Link to="/blog" className="pf__title--link">Blog</Link></li>
                <li ><Link to="/services"className="pf__title--link">Services</Link></li>
                <li ><Link to="/resume" className="pf__title--link">Resume</Link></li>
                <li ><Link to="/home" className="pf__title--link">Home</Link></li>
            </ul>
     </div>)

    }
}
